import { add, sub, mul, div } from './calc';

function App() {
    return (<>
        <ul>
            <li>{add(10, 3)}</li>
            <li>{sub(10, 3)}</li>
            <li>{mul(10, 3)}</li>
            <li>{div(10, 3)}</li>
        </ul>
    </>);
}

export default App
